function getValues(prop) {
    return boundary.features.map(f => f.properties[prop]).filter(v => v != null);
}

let vals_unemp = getValues('_unemployment');
let vals_empl = getValues('_employed');
let vals_vac = getValues('_vacancy');

function breaks(vals) {
    
    let brk = ss.jenks(vals, 6);
    return brk;
}

let breaks_unemp = breaks(vals_unemp);
let breaks_empl = breaks(vals_empl);
let breaks_vac = breaks(vals_vac);

function popup(feature, layer) {
    let p = feature.properties;
    let txt = `<b>${p['Название субъекта РФ']}</b><br>Безработица: ${p['_unemployment']}% <br>Занятые на 1000: ${p['_employed']} <br>Нагрузка: ${p['_vacancy']}`;
    layer.bindPopup(txt);
}

function layer(prop, colors) {
    return L.choropleth(boundary, {
        valueProperty: prop,
        scale: colors,
        steps: 7,
        mode: 'q',
        style: {color: '#fff', weight: 1, fillOpacity: 0.8},
        onEachFeature: popup
    });
}

