let highlightedLayer = null;
const searchControl = new L.Control.Search({
    layer: searchLayer,
    propertyName: 'Название субъекта РФ',
    marker: false,
    textPlaceholder: 'Поиск',
    position: 'topleft',
    moveToLocation: function(latlng, title, map) {
        const zoom = map.getBoundsZoom(latlng.layer.getBounds());
        map.setView(latlng, zoom);
    }
});

searchControl.on('search:locationfound', function(e) {
    if (highlightedLayer && highlightedLayer !== e.layer) {
        searchLayer.resetStyle(highlightedLayer);
    }
    highlightedLayer = e.layer;
    highlightedLayer.setStyle({ color: '#0f0' });  
});

map.on('click', function() {
    if (highlightedLayer) {
        searchLayer.resetStyle(highlightedLayer);
        highlightedLayer = null;
    }
});

map.addControl(searchControl);


L.easyButton('fa fa-home', function(btn, map) {
    map.flyTo(mapOptions.center, mapOptions.zoom, { animate: true, duration: 1 });
}, 'На стартовые координаты').addTo(map);